import React, { Component } from 'react'
import './App.css'

import MovieList from './components/MovieList'
import LoginUser from './components/LoginUser'

class App extends Component {
  render () {
    return (
      <div>
        <LoginUser />
        <MovieList />
      </div>
    )
  }
}

export default App
